import Login from "./login";

function Loginservice(p){
    function setRequest(Data){
        fetch('https://react-9eb50-default-rtdb.firebaseio.com/login.json',
        {
            method:'POST',
            body:JSON.stringify(Data),
            headers:{
                'Content-Type':'application/json'
            }
        }
        );
    }

    return(
        <Login onRequest={setRequest}  />
    );
}

export default Loginservice;
